import { Link,NavLink } from "react-router-dom"
import "./Barra.css";

const Barra = () => {
  return (
    <div>

        <NavLink to="/" className={({isActive}) => (isActive ? "ativo" : "")}>Home</NavLink>
        <NavLink to="/Novidades" className={({isActive}) => (isActive ? "ativo" : "")}>Novidades</NavLink>

    </div>
  )
}

export default Barra
